import { ButtonForm, FormStyle, InputForm, LabelForm } from "./Forms"


const Forms = ()=>{
    return (
        <FormStyle action="">

            
            <LabelForm htmlFor="username">Username: </LabelForm>
            <InputForm type="text" name="username"/>
            

           
            <LabelForm htmlFor="password">Password: </LabelForm>
            <InputForm type="text" name="password"/>
            
            
            
            <ButtonForm type="submit"></ButtonForm>
            
        </FormStyle>
    )
}
export default Forms
